import React from "react";

import { WishlistIconContainer } from "./wishlist-button.styles";
import { ReactComponent as WishListIcon } from "../../assets/wishlist.svg";
import { ReactComponent as WishListIconColored } from "../../assets/wishlist-colored.svg";

const WishListButton = ({ inWishlist }) => {
  return (
    <WishlistIconContainer>
      {inWishlist ? <WishListIconColored /> : <WishListIcon />}
    </WishlistIconContainer>
  );
};

export default WishListButton;
